Information
------------------------------

The Real Angry Birds 
Angry birds are very popular with game-playing kids, but how do wild birds' battles to survive, find food and raise their young compare?
Everyone loves a nice game of Angry Birds on their phone, but are there any real angry birds out there? Find out in The Real Angry Birds on Nat Geo Wild.
In the wild birds must battle to survive, find food and shelter, avoid danger and, during all of this, they have a responsibility to raise their young. 
Life is tough for a bird, and the only way they can guarantee survival is to be ready when push comes to shove, to get their talons out and fight. 
From golden eagles and swans to the white throated manakin, spoonbill and goshawk, there are many species of bird and each have a unique fighting technique to try to come out on top. 
With a whip of their wings, a bite of their beak or tearing with their talons, these birds can inflict extreme damage on their enemies. Be afraid...be very afraid... 
From featherweight food fights to big bird battles - take a look at the birds that have earned their title as true Angry Birds.

